import React from "react";

const Display = (props) => {
  // Access the infoList data from props and extract the name parameter
  const { infoList } = props;
  const name = infoList.length > 0 ? infoList[0].name : ""; // assuming name is the first item in the infoList array

  return (
    <div>
      {/* Display the name parameter */}
      <h1>Name: {name}</h1>
    </div>
  );
};

export default Display;
